package basicjava;

public class ArithmaticOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

	System.out.println("Arithematic Operator");
	
	//+, -, *, /, %
	
	int a= 10;
	int b=15;
	System.out.println(a+b);
	System.out.println(a-b);
	System.out.println(a*b);
	System.out.println(a/b);
	System.out.println(a%b);
	
	
	
	
	}

}
